import React  from "react";

function Table_column_child(props){
    console.log("Table_column_child");
    //let style_p = {display:"none"};
    //let style_p2 = {display:"none"};
    //let style_p3 = {display:"none"};
    //let style_p4 = {display:"none"};
    //let style_s = {display:"none"};
    //let style_s2 = {display:"none"};
    //let style_s3 = {display:"none"};
    //let style_s4 = {display:"none"};

    let style_p = [{display:"none"},{display:"none"},{display:"none"},{display:"none"}]
    let style_s = [{display:"none"},{display:"none"},{display:"none"},{display:"none"}]

    if(props.num === props.boy_p.boy1) style_p = {display:"block"}
    if(props.num === props.boy_p.boy2) style_p2 = {display:"block"}
    if(props.num === props.boy_p.boy3) style_p3 = {display:"block"}
    if(props.num === props.boy_p.boy4) style_p4 = {display:"block"}
    if(props.num === props.boy_s.boy1) style_s = {display:"block"}
    if(props.num === props.boy_s.boy2) style_s2 = {display:"block"}
    if(props.num === props.boy_s.boy3) style_s3 = {display:"block"}
    if(props.num === props.boy_s.boy4) style_s4 = {display:"block"}
    return(
        <div className={`${props.table_column_children} d-flex justify-content-center align-items-center border-dark`}>
            <div style={{position:"absolute"}}> {props.num} </div>
            
            <div onClick={()=>{if(props.p_yakliki)props.calcule("boy_p_1")}} style={style_p}  className={`rounded-circle border Boy bg-primary`}></div>
            <div onClick={()=>{if(props.p_yakliki)props.calcule("boy_p_2")}} style={style_p2} className={`rounded-circle border Boy bg-primary`}></div>
            <div onClick={()=>{if(props.p_yakliki)props.calcule("boy_p_3")}} style={style_p3} className={`rounded-circle border Boy bg-primary`}></div>
            <div onClick={()=>{if(props.p_yakliki)props.calcule("boy_p_4")}} style={style_p4} className={`rounded-circle border Boy bg-primary`}></div>

            <div onClick={()=>{if(props.s_yakliki)props.calcule("boy_s_1")}} style={style_s}  className={`rounded-circle border Boy bg-success`}></div>
            <div onClick={()=>{if(props.s_yakliki)props.calcule("boy_s_2")}} style={style_s2} className={`rounded-circle border Boy bg-success`}></div>
            <div onClick={()=>{if(props.s_yakliki)props.calcule("boy_s_3")}} style={style_s3} className={`rounded-circle border Boy bg-success`}></div>
            <div onClick={()=>{if(props.s_yakliki)props.calcule("boy_s_4")}} style={style_s4} className={`rounded-circle border Boy bg-success`}></div>
        </div>
    )
}

export default React.memo(Table_column_child);
